__NUXT_JSONP__("/drugs/Dinutuximab", (function(a,b,c,d){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[{brand:b,indication:"1 INDICATIONS AND USAGE Unituxin (dinutuximab) is indicated, in combination with granulocyte-macrophage colony-stimulating factor (GM-CSF), interleukin-2 (IL-2), and 13-cis-retinoic acid (RA), for the treatment of pediatric patients with high-risk neuroblastoma who achieve at least a partial response to prior first-line multiagent, multimodality therapy [see Clinical Studies (14) ]. Unituxin is a GD2-binding monoclonal antibody indicated, in combination with granulocyte-macrophage colony-stimulating factor (GM-CSF), interleukin-2 (IL-2), and 13-cis-retinoic acid (RA), for the treatment of pediatric patients with high-risk neuroblastoma who achieve at least a partial response to prior first-line multiagent, multimodality therapy. ( 1 )",manufacturer:"United Therapeutics Corporation",splSetId:"d66bdf0d-9d65-45de-ae5b-a58617c27492"}],id:a,nciThesaurus:{casRegistry:"1363687-32-4",chebiId:c,chemicalFormula:c,definition:"A chimeric mouse\u002Fhuman monoclonal antibody with potential antineoplastic activity. Dinutuximab binds to the ganglioside GD2 and induces antibody-dependent cell-mediated cytotoxicity and complement-dependent cytotoxicity against GD2-expressing tumor cells.  GD2 is overexpressed in malignant melanoma, neuroblastoma, osteosarcoma, and small cell carcinoma of the lung.",fdaUniiCode:"7SQY4ZUD30",identifier:"C1570",preferredName:a,semanticType:"Amino Acid, Peptide, or Protein",subclassOf:["C155653"],synonyms:["Ch 14.18UTC","Ch14.18","DINUTUXIMAB",a,"MOAB Ch14.18",b,"monoclonal antibody Ch14.18"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FDinutuximab",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("Dinutuximab","Unituxin","","2021-10-30T13:34:33.513Z")));